import http from "../http-common";

const getAll = () => {
    return http.get("/supportsInv");
};

const getById = id => {
    return http.get(`/supportsInv/${id}`);
};

const getByPropositionId = idProposition => {
    const params = {
        idProposition: idProposition
    }
    console.log(idProposition);
    // return http.get(`/supportsInv/getByPropositionId/${idProposition}`);
    return http.post("/supportsInv/getByPropositionId/", { params });
};


export default {
    getAll,
    getById,
    getByPropositionId
};
